import logo from './logo.svg';
import './App.css';
const element = <h1>Hello, world</h1>;
const root = ReactDOM.createRoot(
  document.getElementById('root')
);
function App() {
  return (
    <div className="App">
      <header>
      root.render()
      </header>
    </div>
  );
}

export default App;
